INSERT INTO `api_http_resonse` (`id`, `code`, `title`, `description`, `type`) VALUES
(1, '100', '100 Continue', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: \"Source Code Pro\"; text-transform: uppercase;\">1×× INFORMATIONAL</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: \"Source Code Pro\"; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">100</span> CONTINUE</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">The initial part of a request has been received and has not yet been rejected by the server. The server intends to send a final response after the request has been fully received and acted upon.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">When the request contains an Expect header field that includes a 100-continue expectation, the 100 response indicates that the server wishes to receive the request payload body<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/100#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>. The client ought to continue sending the request and discard the 100 response.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">If the request did not contain an Expect header field containing the 100-continue expectation, the client can simply discard this interim response.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span> Expect <a href=\"http://tools.ietf.org/html/rfc7231#section-5.1.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 5.1.1</a></span></li><li style=\"margin: 6px 0px 0px;\">Source: <a href=\"http://tools.ietf.org/html/rfc7231#section-6.2.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.1.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: \"Source Code Pro\"; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">100</span> CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Rails HTTP Status Symbol <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:continue</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Go HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusContinue</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Symfony HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_CONTINUE</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Python2 HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.CONTINUE</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Python3+ HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.CONTINUE</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Python3.5+ HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.CONTINUE</code></p>', '1×× Informational'),
(2, '101', '101 Switching Protocols', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">1×× INFORMATIONAL</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">101</span>&nbsp;SWITCHING PROTOCOLS</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server understands and is willing to comply with the client\'s request, via the Upgrade header field<span style=\"font-size: 13.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/101#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>, for a change in the application protocol being used on this connection.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server MUST generate an Upgrade header field in the response that indicates which protocol(s) will be switched to immediately after the empty line that terminates the 101 response.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">It is assumed that the server will only agree to switch protocols when it is advantageous to do so. For example, switching to a newer version of HTTP might be advantageous over older versions, and switching to a real-time, synchronous protocol might be advantageous when delivering resources that use such features.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Upgrade&nbsp;<a href=\"http://tools.ietf.org/html/rfc7230#section-6.7\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7230 Section 6.7</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.2.2</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">101</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:switching_protocols</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusSwitchingProtocols</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_SWITCHING_PROTOCOLS</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.SWITCHING_PROTOCOLS</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.SWITCHING_PROTOCOLS</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.SWITCHING_PROTOCOLS</code></p>', '1×× Informational'),
(3, '102', '102 Processing ( WebDAV; RFC 2518)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">1×× INFORMATIONAL</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">102</span>&nbsp;PROCESSING</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">An interim response used to inform the client that the server has accepted the complete request, but has not yet completed it.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">This status code SHOULD only be sent when the server has a reasonable expectation that the request will take significant time to complete. As guidance, if a method is taking longer than 20 seconds (a reasonable, but arbitrary value) to process the server SHOULD return a 102 (Processing) response. The server MUST send a final response after the request has been completed.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Methods can potentially take a long period of time to process, especially methods that support the Depth header. In such cases the client may time-out the connection while waiting for a response. To prevent this the server may return a 102 Processing status code to indicate to the client that the server is still processing the method.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc2518#section-10.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC2518 Section 10.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">102</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:processing</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_PROCESSING</code></p>', '1×× Informational'),
(4, '200', '200 OK', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: \"Source Code Pro\"; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: \"Source Code Pro\"; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">200</span> OK</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">The request has succeeded.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">The payload sent in a 200 response depends on the request method. For the methods defined by this specification, the intended meaning of the payload can be summarized as:</p><ul style=\"list-style-position: outside; list-style-image: initial; padding-left: 0px; margin: 0px 0px 10px 20px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\"><li style=\"margin: 2px 0px 0px;\"><code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">GET</code> a representation of the target resource</li><li style=\"margin: 2px 0px 0px;\"><code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">HEAD</code> the same representation as <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">GET</code>, but without the representation data</li><li style=\"margin: 2px 0px 0px;\"><code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">POST</code> a representation of the status of, or results obtained from, the action;<ul style=\"list-style-position: outside; list-style-image: initial; padding-left: 0px; margin: 5px 0px 0px 10px;\"><li style=\"margin: 2px 0px 0px;\"><code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">PUT</code> <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">DELETE</code> a representation of the status of the action;</li><li style=\"margin: 2px 0px 0px;\"><code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">OPTIONS</code> a representation of the communications options;</li><li style=\"margin: 2px 0px 0px;\"><code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">TRACE</code> a representation of the request message as received by the end server.</li></ul></li></ul><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Aside from responses to CONNECT, a 200 response always has a payload, though an origin server MAY generate a payload body of zero length. If no payload is desired, an origin server ought to send <a href=\"https://httpstatuses.com/204\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">204 No Content</a> instead. For CONNECT, no payload is allowed because the successful result is a tunnel, which begins immediately after the 200 response header section.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">A 200 response is cacheable by default; i.e., unless otherwise indicated by the method definition or explicit cache controls<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/200#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span> Calculating Heuristic Freshness <a href=\"http://tools.ietf.org/html/rfc7234#section-4.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 4.2.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source: <a href=\"http://tools.ietf.org/html/rfc7231#section-6.3.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.3.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: \"Source Code Pro\"; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">200</span> CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Rails HTTP Status Symbol <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:ok</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Go HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusOK</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Symfony HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_OK</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Python2 HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.OK</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Python3+ HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.OK</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: \"Open Sans\", sans-serif;\">Python3.5+ HTTP Status Constant <code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.OK</code></p>', '2×× Success'),
(5, '201', '201 Created', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">201</span>&nbsp;CREATED</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The request has been fulfilled and has resulted in one or more new resources being created.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The primary resource created by the request is identified by either a Location header field in the response or, if no Location field is received, by the effective request URI.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The 201 response payload typically describes and links to the resource(s) created. See&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-7.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">Section 7.2 of RFC7231</a>&nbsp;for a discussion of the meaning and purpose of validator header fields, such as ETag and Last-Modified, in a 201 response.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.3.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.3.2</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">201</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:created</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusCreated</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_CREATED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.CREATED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.CREATED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.CREATED</code></p>', '2×× Success'),
(6, '202', '202 Accepted', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">202</span>&nbsp;ACCEPTED</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The request has been accepted for processing, but the processing has not been completed. The request might or might not eventually be acted upon, as it might be disallowed when processing actually takes place.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">There is no facility in HTTP for re-sending a status code from an asynchronous operation.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The 202 response is intentionally noncommittal. Its purpose is to allow a server to accept a request for some other process (perhaps a batch-oriented process that is only run once per day) without requiring that the user agent\'s connection to the server persist until the process is completed. The representation sent with this response ought to describe the request\'s current status and point to (or embed) a status monitor that can provide the user with an estimate of when the request will be fulfilled.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.3.3\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.3.3</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">202</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:accepted</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusAccepted</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_ACCEPTED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.ACCEPTED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.ACCEPTED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.ACCEPTED</code></p>', '2×× Success'),
(7, '203', '203 Non-Authoritative Information (since HTTP/1.1)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">203</span>&nbsp;NON-AUTHORITATIVE INFORMATION</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The request was successful but the enclosed payload has been modified from that of the origin server\'s&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response by a transforming proxy<span style=\"font-size: 13.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/203#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">This status code allows the proxy to notify recipients when a transformation has been applied, since that knowledge might impact later decisions regarding the content. For example, future cache validation requests for the content might only be applicable along the same request path (through the same proxies).</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The 203 response is similar to the Warning code of 214 Transformation Applied<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/203#ref-2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">2</a></span>, which has the advantage of being applicable to responses with any status code.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 203 response is cacheable by default; i.e., unless otherwise indicated by the method definition or explicit cache controls<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/203#ref-3\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">3</a></span>.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Transformations&nbsp;<a href=\"http://tools.ietf.org/html/rfc7230#section-5.7.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7230 Section 5.7.2</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-2\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">2</span>&nbsp;Warning&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-5.5\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 5.5</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-3\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</span>&nbsp;Calculating Heuristic Freshness&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-4.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 4.2.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.3.4\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.3.4</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">203</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:non_authoritative_information</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusNonAuthoritativeInfo</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_NON_AUTHORITATIVE_INFORMATION</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.NON_AUTHORITATIVE_INFORMATION</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.NON_AUTHORITATIVE_INFORMATION</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.NON_AUTHORITATIVE_INFORMATION</code></p>', '2×× Success'),
(8, '204', '204 No Content', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">204</span>&nbsp;NO CONTENT</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server has successfully fulfilled the request and that there is no additional content to send in the response payload body.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Metadata in the response header fields refer to the target resource and its selected representation after the requested action was applied.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">For example, if a 204 status code is received in response to a PUT request and the response contains an ETag header field, then the PUT was successful and the ETag field-value contains the entity-tag for the new representation of that target resource.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The 204 response allows a server to indicate that the action has been successfully applied to the target resource, while implying that the user agent does not need to traverse away from its current \"document view\" (if any). The server assumes that the user agent will provide some indication of the success to its user, in accord with its own interface, and apply any new or updated metadata in the response to its active representation.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">For example, a 204 status code is commonly used with document editing interfaces corresponding to a \"save\" action, such that the document being saved remains available to the user for editing. It is also frequently used with interfaces that expect automated data transfers to be prevalent, such as within distributed version control systems.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 204 response is terminated by the first empty line after the header fields because it cannot contain a message body.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 204 response is cacheable by default; i.e., unless otherwise indicated by the method definition or explicit cache controls<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/204#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Calculating Heuristic Freshness&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-4.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 4.2.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.3.5\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.3.5</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">204</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:no_content</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusNoContent</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_NO_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.NO_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.NO_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.NO_CONTENT</code></p>', '2×× Success');
INSERT INTO `api_http_resonse` (`id`, `code`, `title`, `description`, `type`) VALUES
(9, '205', '205 Reset Content', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">205</span>&nbsp;RESET CONTENT</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server has fulfilled the request and desires that the user agent reset the \"document view\", which caused the request to be sent, to its original state as received from the origin server.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">This response is intended to support a common data entry use case where the user receives content that supports data entry (a form, notepad, canvas, etc.), enters or manipulates data in that space, causes the entered data to be submitted in a request, and then the data entry mechanism is reset for the next entry so that the user can easily initiate another input action.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Since the 205 status code implies that no additional content will be provided, a server MUST NOT generate a payload in a 205 response. In other words, a server MUST do one of the following for a 205 response: a) indicate a zero-length body for the response by including a Content-Length header field with a value of 0; b) indicate a zero-length payload for the response by including a Transfer-Encoding header field with a value of chunked and a message body consisting of a single chunk of zero-length; or, c) close the connection immediately after sending the blank line terminating the header section.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.3.6\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.3.6</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">205</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:reset_content</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusResetContent</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_RESET_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.RESET_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.RESET_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.RESET_CONTENT</code></p>', '2×× Success'),
(10, '206', '206 Partial Content ( RFC 7233)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">206</span>&nbsp;PARTIAL CONTENT</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server is successfully fulfilling a range request for the target resource by transferring one or more parts of the selected representation that correspond to the satisfiable ranges found in the request\'s Range header field<span style=\"font-size: 13.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/206#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">If a single part is being transferred, the server generating the 206 response MUST generate a Content-Range header field, describing what range of the selected representation is enclosed, and a payload consisting of the range. For example:</p><pre style=\"overflow: auto; font-family: monospace, monospace; font-size: 15px; margin-bottom: 2.5rem; color: rgb(85, 98, 112);\"><code style=\"font-family: monospace, monospace; font-size: 13.5px; padding: 1rem 1.5rem; margin: 0px 0.2rem; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll; display: block;\">HTTP/1.1 206 Partial ContentDate: Wed, 15 Nov 1995 06:25:24 GMTLast-Modified: Wed, 15 Nov 1995 04:58:08 GMTContent-Range: bytes 21010-47021/47022Content-Length: 26012Content-Type: image/gif... 26012 bytes of partial image data ...</code></pre><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">If multiple parts are being transferred, the server generating the 206 response MUST generate a \"multipart/byteranges\" payload<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/206#ref-2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">2</a></span>, and a Content-Type header field containing the multipart/byteranges media type and its required boundary parameter. To avoid confusion with single-part responses, a server MUST NOT generate a Content-Range header field in the HTTP header section of a multiple part response (this field will be sent in each part instead).</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Within the header area of each body part in the multipart payload, the server MUST generate a Content-Range header field corresponding to the range being enclosed in that body part. If the selected representation would have had a Content-Type header field in a&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response, the server SHOULD generate that same Content-Type field in the header area of each body part. For example:</p><pre style=\"overflow: auto; font-family: monospace, monospace; font-size: 15px; margin-bottom: 2.5rem; color: rgb(85, 98, 112);\"><code style=\"font-family: monospace, monospace; font-size: 13.5px; padding: 1rem 1.5rem; margin: 0px 0.2rem; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll; display: block;\">HTTP/1.1 206 Partial ContentDate: Wed, 15 Nov 1995 06:25:24 GMTLast-Modified: Wed, 15 Nov 1995 04:58:08 GMTContent-Length: 1741Content-Type: multipart/byteranges; boundary=THIS_STRING_SEPARATES--THIS_STRING_SEPARATESContent-Type: application/pdfContent-Range: bytes 500-999/8000...the first range...--THIS_STRING_SEPARATESContent-Type: application/pdfContent-Range: bytes 7000-7999/8000...the second range--THIS_STRING_SEPARATES--</code></pre><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">When multiple ranges are requested, a server MAY coalesce any of the ranges that overlap, or that are separated by a gap that is smaller than the overhead of sending multiple parts, regardless of the order in which the corresponding byte-range-spec appeared in the received Range header field. Since the typical overhead between parts of a multipart/byteranges payload is around 80 bytes, depending on the selected representation\'s media type and the chosen boundary parameter length, it can be less efficient to transfer many small disjoint parts than it is to transfer the entire selected representation.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A server MUST NOT generate a multipart response to a request for a single range, since a client that does not request multiple parts might not support multipart responses. However, a server MAY generate a multipart/byteranges payload with only a single body part if multiple ranges were requested and only one range was found to be satisfiable or only one range remained after coalescing. A client that cannot process a multipart/byteranges response MUST NOT generate a request that asks for multiple ranges.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">When a multipart response payload is generated, the server SHOULD send the parts in the same order that the corresponding byte-range-spec appeared in the received Range header field, excluding those ranges that were deemed unsatisfiable or that were coalesced into other ranges. A client that receives a multipart response MUST inspect the Content-Range header field present in each body part in order to determine which range is contained in that body part; a client cannot rely on receiving the same ranges that it requested, nor the same order that it requested.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">When a 206 response is generated, the server MUST generate the following header fields, in addition to those required above, if the field would have been sent in a&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response to the same request: Date, Cache-Control, ETag, Expires, Content-Location, and Vary.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">If a 206 is generated in response to a request with an If-Range header field, the sender SHOULD NOT generate other representation header fields beyond those required above, because the client is understood to already have a prior response containing those header fields. Otherwise, the sender MUST generate all of the representation header fields that would have been sent in a&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response to the same request.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 206 response is cacheable by default; i.e., unless otherwise indicated by explicit cache controls<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/206#ref-3\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">3</a></span>.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Range&nbsp;<a href=\"http://tools.ietf.org/html/rfc7233#section-3.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7233 Section 3.1</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-2\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">2</span>&nbsp;Internet Media Type multipart/byteranges&nbsp;<a href=\"http://tools.ietf.org/html/rfc7233#appendix-A\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7233 Appendix A</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-3\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</span>&nbsp;Calculating Heuristic Freshness&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-4.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 4.2.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7233#section-4.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7233 Section 4.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">206</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:partial_content</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusPartialContent</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_PARTIAL_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.PARTIAL_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.PARTIAL_CONTENT</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.PARTIAL_CONTENT</code></p>', '2×× Success'),
(11, '207', '207 Multi-Status (WebDAV; RFC 4918)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">207</span>&nbsp;MULTI-STATUS</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A Multi-Status response conveys information about multiple resources in situations where multiple status codes might be appropriate.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The default Multi-Status response body is a text/xml or application/xml HTTP entity with a \'multistatus\' root element. Further elements contain 200, 300, 400, and 500 series status codes generated during the method invocation. 100 series status codes SHOULD NOT be recorded in a \'response\' XML element.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Although \'207\' is used as the overall response status code, the recipient needs to consult the contents of the multistatus response body for further information about the success or failure of the method execution. The response MAY be used in success, partial success and also in failure situations.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The \'multistatus\' root element holds zero or more \'response\' elements in any order, each with information about an individual resource. Each \'response\' element MUST have an \'href\' element to identify the resource.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A Multi-Status response uses one out of two distinct formats for representing the status:</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">1. A \'status\' element as child of the \'response\' element indicates the status of the message execution for the identified resource as a whole<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/207#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>. Some method definitions provide information about specific status codes clients should be prepared to see in a response. However, clients MUST be able to handle other status codes, using the generic rules defined in&nbsp;<a href=\"http://tools.ietf.org/html/rfc2616#section-10\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC2616 Section 10</a>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">2. For PROPFIND and PROPPATCH, the format has been extended using the \'propstat\' element instead of \'status\', providing information about individual properties of a resource. This format is specific to PROPFIND and PROPPATCH, and is described in detail in&nbsp;<a href=\"http://tools.ietf.org/html/rfc4918#section-9.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC4918 Section 9.1</a>&nbsp;and&nbsp;<a href=\"http://tools.ietf.org/html/rfc4918#section-9.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC4918 Section 9.2</a>.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Example - DELETE&nbsp;<a href=\"http://tools.ietf.org/html/rfc4918#section-9.6.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC4918 Section 9.6.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc4918#section-13\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC4918 Section 13</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">207</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:multi_status</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_MULTI_STATUS</code></p>', '2×× Success'),
(12, '208', '208 Already Reported (WebDAV; RFC 5842)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">208</span>&nbsp;ALREADY REPORTED</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Used inside a DAV: propstat response element to avoid enumerating the internal members of multiple bindings to the same collection repeatedly.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">For each binding to a collection inside the request\'s scope, only one will be reported with a 200 status, while subsequent DAV:response elements for all other bindings will use the 208 status, and no DAV:response elements for their descendants are included.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Note that the 208 status will only occur for \"Depth: infinity\" requests, and that it is of particular importance when the multiple collection bindings cause a bind loop<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/208#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A client can request the DAV:resource-id property in a PROPFIND request to guarantee that they can accurately reconstruct the binding structure of a collection with multiple bindings to a single resource.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">For backward compatibility with clients not aware of the 208 status code appearing in multistatus response bodies, it SHOULD NOT be used unless the client has signaled support for this specification using the \"DAV\" request header<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/208#ref-2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">2</a></span>. Instead, a&nbsp;<a href=\"https://httpstatuses.com/508\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">508 Loop Detected</a>&nbsp;status should be returned when a binding loop is discovered. This allows the server to return the 508 as the top-level return status, if it discovers it before it started the response, or in the middle of a multistatus, if it discovers it in the middle of streaming out a multistatus response.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;URI Mappings Created by a New Binding&nbsp;<a href=\"http://tools.ietf.org/html/rfc5842#section-2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC5842 Section 2.2</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-2\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">2</span>&nbsp;\'DAV\' Request Header&nbsp;<a href=\"http://tools.ietf.org/html/rfc5842#section-8.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC5842 Section 8.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc5842#section-7.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC5842 Section 7.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">208</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_ALREADY_REPORTED</code></p>', '2×× Success'),
(13, '226', '226 IM Used (RFC 3229)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">2×× SUCCESS</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">226</span>&nbsp;IM USED</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server has fulfilled a GET request for the resource, and the response is a representation of the result of one or more instance-manipulations applied to the current instance.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The actual current instance might not be available except by combining this response with other previous or future responses, as appropriate for the specific instance-manipulation(s). If so, the headers of the resulting instance are the result of combining the headers from the 226 response and the other instances, following the rules in&nbsp;<a href=\"http://tools.ietf.org/html/rfc2616#section-13.5.3\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">section 13.5.3</a>&nbsp;of the HTTP/1.1 specification.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The request MUST have included an A-IM header field listing at least one instance-manipulation. The response MUST include an Etag header field giving the entity tag of the current instance.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A response received with a status code of 226 MAY be stored by a cache and used in reply to a subsequent request, subject to the HTTP expiration mechanism and any Cache-Control headers, and to the requirements in&nbsp;<a href=\"http://tools.ietf.org/html/rfc3229#section-10.6\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">section 10.6</a>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A response received with a status code of 226 MAY be used by a cache, in conjunction with a cache entry for the base instance, to create a cache entry for the current instance.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc3229#section-10.4.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC3229 Section 10.4.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">226</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:im_used</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_IM_USED</code></p>', '2×× Success'),
(14, '300', '300 Multiple Choices', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">3×× REDIRECTION</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">300</span>&nbsp;MULTIPLE CHOICES</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The target resource has more than one representation, each with its own more specific identifier, and information about the alternatives is being provided so that the user (or user agent) can select a preferred representation by redirecting its request to one or more of those identifiers.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">In other words, the server desires that the user agent engage in reactive negotiation to select the most appropriate representation(s) for its needs<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/300#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">If the server has a preferred choice, the server SHOULD generate a Location header field containing a preferred choice\'s URI reference. The user agent MAY use the Location field value for automatic redirection.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">For request methods other than HEAD, the server SHOULD generate a payload in the 300 response containing a list of representation metadata and URI reference(s) from which the user or user agent can choose the one most preferred. The user agent MAY make a selection from that list automatically if it understands the provided media type. A specific format for automatic selection is not defined by this specification because HTTP tries to remain orthogonal to the definition of its payloads. In practice, the representation is provided in some easily parsed format believed to be acceptable to the user agent, as determined by shared design or content negotiation, or in some commonly accepted hypertext format.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 300 response is cacheable by default; i.e., unless otherwise indicated by the method definition or explicit cache controls<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/300#ref-2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">2</a></span>.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Note: The original proposal for the 300 status code defined the URI header field as providing a list of alternative representations, such that it would be usable for 200, 300, and 406 responses and be transferred in responses to the HEAD method. However, lack of deployment and disagreement over syntax led to both URI and Alternates (a subsequent proposal) being dropped from this specification. It is possible to communicate the list using a set of Link header fields<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/300#ref-3\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">3</a></span>, each with a relationship of \"alternate\", though deployment is a chicken-and-egg problem.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Content Negotiation&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-3.4\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 3.4</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-2\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">2</span>&nbsp;Calculating Heuristic Freshness&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-4.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 4.2.2</a></span></li><li style=\"margin: 0px;\"><span id=\"ref-3\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">3</span>&nbsp;Web Linking&nbsp;<a href=\"http://tools.ietf.org/html/rfc5988\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC5988</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.4.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.4.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">300</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:multiple_choices</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusMultipleChoices</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_MULTIPLE_CHOICES</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.MULTIPLE_CHOICES</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.MULTIPLE_CHOICES</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.MULTIPLE_CHOICES</code></p>', '3×× Redirection');
INSERT INTO `api_http_resonse` (`id`, `code`, `title`, `description`, `type`) VALUES
(15, '301', '301 Moved Permanently', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">3×× REDIRECTION</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">301</span>&nbsp;MOVED PERMANENTLY</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The target resource has been assigned a new permanent URI and any future references to this resource ought to use one of the enclosed URIs.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Clients with link-editing capabilities ought to automatically re-link references to the effective request URI to one or more of the new references sent by the server, where possible.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server SHOULD generate a Location header field in the response containing a preferred URI reference for the new permanent URI. The user agent MAY use the Location field value for automatic redirection. The server\'s response payload usually contains a short hypertext note with a hyperlink to the new URI(s).</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Note: For historical reasons, a user agent MAY change the request method from POST to GET for the subsequent request. If this behavior is undesired, the&nbsp;<a href=\"https://httpstatuses.com/307\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">307 Temporary Redirect</a>&nbsp;status code can be used instead.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 301 response is cacheable by default; i.e., unless otherwise indicated by the method definition or explicit cache controls<span style=\"font-size: 10.5px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\"><a href=\"https://httpstatuses.com/301#ref-1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">1</a></span>.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 0px;\"><span id=\"ref-1\"><span style=\"font-size: 9px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em;\">1</span>&nbsp;Calculating Heuristic Freshness&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-4.2.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7234 Section 4.2.2</a></span></li><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.4.2\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.4.2</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">301</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:moved_permanently</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusMovedPermanently</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_MOVED_PERMANENTLY</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.MOVED_PERMANENTLY</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.MOVED_PERMANENTLY</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.MOVED_PERMANENTLY</code></p>', '3×× Redirection'),
(16, '302', '302 Found', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">3×× REDIRECTION</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">302</span>&nbsp;FOUND</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The target resource resides temporarily under a different URI. Since the redirection might be altered on occasion, the client ought to continue to use the effective request URI for future requests.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server SHOULD generate a Location header field in the response containing a URI reference for the different URI. The user agent MAY use the Location field value for automatic redirection. The server\'s response payload usually contains a short hypertext note with a hyperlink to the different URI(s).</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Note: For historical reasons, a user agent MAY change the request method from POST to GET for the subsequent request. If this behavior is undesired, the&nbsp;<a href=\"https://httpstatuses.com/307\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">307 Temporary Redirect</a>&nbsp;status code can be used instead.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.4.3\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7231 Section 6.4.3</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">302</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:found</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusFound</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_FOUND</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.FOUND</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.FOUND</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.FOUND</code></p>', '3×× Redirection'),
(17, '303', '303 See Other (since HTTP/1.1)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">3×× REDIRECTION</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">303</span>&nbsp;SEE OTHER</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server is redirecting the user agent to a different resource, as indicated by a URI in the Location header field, which is intended to provide an indirect response to the original request.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A user agent can perform a retrieval request targeting that URI (a GET or HEAD request if using HTTP), which might also be redirected, and present the eventual result as an answer to the original request. Note that the new URI in the Location header field is not considered equivalent to the effective request URI.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">This status code is applicable to any HTTP method. It is primarily used to allow the output of a POST action to redirect the user agent to a selected resource, since doing so provides the information corresponding to the POST response in a form that can be separately identified, bookmarked, and cached, independent of the original request.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 303 response to a GET request indicates that the origin server does not have a representation of the target resource that can be transferred by the server over HTTP. However, the Location field value refers to a resource that is descriptive of the target resource, such that making a retrieval request on that other resource might result in a representation that is useful to recipients without implying that it represents the original target resource. Note that answers to the questions of what can be represented, what representations are adequate, and what might be a useful description are outside the scope of HTTP.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Except for responses to a HEAD request, the representation of a 303 response ought to contain a short hypertext note with a hyperlink to the same URI reference provided in the Location header field.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7231#section-6.4.4\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7321 Section 6.4.4</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">303</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:see_other</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusSeeOther</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_SEE_OTHER</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.SEE_OTHER</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.SEE_OTHER</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.SEE_OTHER</code></p>', '3×× Redirection'),
(18, '304', '304 Not Modified ( RFC 7232)', '<h2 style=\"margin-bottom: 8px; font-weight: bold; font-size: 20px; line-height: 1.25; letter-spacing: 0.5px; color: rgb(187, 187, 187); font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\">3×× REDIRECTION</h2><h1 style=\"font-size: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">304</span>&nbsp;NOT MODIFIED</h1><p style=\"margin-bottom: 10px; font-size: 18px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A conditional GET or HEAD request has been received and would have resulted in a&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response if it were not for the fact that the condition evaluated to false.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">In other words, there is no need for the server to transfer a representation of the target resource because the request indicates that the client, which made the request conditional, already has a valid representation; the server is therefore redirecting the client to make use of that stored representation as if it were the payload of a&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">The server generating a 304 response MUST generate any of the following header fields that would have been sent in a&nbsp;<a href=\"https://httpstatuses.com/200\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">200 OK</a>&nbsp;response to the same request: Cache-Control, Content-Location, Date, ETag, Expires, and Vary.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Since the goal of a 304 response is to minimize information transfer when the recipient already has one or more cached representations, a sender SHOULD NOT generate representation metadata other than the above listed fields unless said metadata exists for the purpose of guiding cache updates (e.g., Last-Modified might be useful if the response does not have an ETag field).</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Requirements on a cache that receives a 304 response are defined in&nbsp;<a href=\"http://tools.ietf.org/html/rfc7234#section-4.3.4\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">Section 4.3.4 of RFC7234</a>. If the conditional request originated with an outbound client, such as a user agent with its own cache sending a conditional GET to a shared proxy, then the proxy SHOULD forward the 304 response to that client.</p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">A 304 response cannot contain a message-body; it is always terminated by the first empty line after the header fields.</p><hr style=\"box-sizing: content-box; height: 0px; margin-top: 10px; margin-bottom: 10px; border-bottom-width: 0px; border-top-color: rgb(238, 238, 238); color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px;\"><ul style=\"list-style: none outside; padding-left: 0px; margin: 0px; font-size: 12px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\"><li style=\"margin: 6px 0px 0px;\">Source:&nbsp;<a href=\"http://tools.ietf.org/html/rfc7232#section-4.1\" style=\"background-color: transparent; color: rgb(214, 21, 109); font-weight: bold; text-decoration: none;\">RFC7232 Section 4.1</a></li></ul><h1 class=\"section\" style=\"font-size: 20px; margin-top: 20px; margin-bottom: 8px; font-weight: bold; line-height: 1.2; letter-spacing: 0.5px; font-family: &quot;Source Code Pro&quot;; text-transform: uppercase;\"><span style=\"color: rgb(214, 21, 109);\">304</span>&nbsp;CODE REFERENCES</h1><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Rails HTTP Status Symbol&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">:not_modified</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Go HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.StatusNotModified</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Symfony HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">Response::HTTP_NOT_MODIFIED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python2 HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">httplib.NOT_MODIFIED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.client.NOT_MODIFIED</code></p><p style=\"margin-bottom: 10px; color: rgb(85, 98, 112); font-family: &quot;Open Sans&quot;, sans-serif;\">Python3.5+ HTTP Status Constant&nbsp;<code style=\"font-family: monospace, monospace; font-size: 12.6px; padding: 0.2rem 0.5rem; margin: 0px 0.2rem; white-space: nowrap; background: rgb(255, 255, 255); border-width: 1px; border-style: solid; border-color: rgb(225, 225, 225); border-radius: 4px; overflow: scroll;\">http.HTTPStatus.NOT_MODIFIED</code></p>', '3×× Redirection'),
(19, '305', '305 Use Proxy (since HTTP/1.1)', 'The requested resource is available only through a proxy, the address for which is provided in the response. Many HTTP clients (such as  <a href=\"/wiki/Mozilla\" title=\"Mozilla\">Mozilla</a> <sup id=\"cite_ref-mozilla_bugzilla_bug_187996_27-0\" class=\"reference\"> <a href=\"#cite_note-mozilla_bugzilla_bug_187996-27\">[26]</a> </sup> and  <a href=\"/wiki/Internet_Explorer\" title=\"Internet Explorer\">Internet Explorer</a>) do not correctly handle responses with this status code, primarily for security reasons. <sup id=\"cite_ref-mozilla_bugzilla_bug_187996_comment_13_28-0\" class=\"reference\"> <a href=\"#cite_note-mozilla_bugzilla_bug_187996_comment_13-28\">[27]</a> </sup>', '3×× Redirection'),
(20, '306', '306 Switch Proxy', 'No longer used. Originally meant \"Subsequent requests should use the specified proxy.\" <sup id=\"cite_ref-29\" class=\"reference\"> <a href=\"#cite_note-29\">[28]</a> </sup>', '3×× Redirection'),
(21, '307', '307 Temporary Redirect (since HTTP/1.1)', 'In this case, the request should be repeated with another URI; however, future requests should still use the original URI. In contrast to how 302 was historically implemented, the request method is not allowed to be changed when reissuing the original request. For example, a POST request should be repeated using another POST request. <sup id=\"cite_ref-SemanticsAndContent_30-0\" class=\"reference\"> <a href=\"#cite_note-SemanticsAndContent-30\">[29]</a> </sup>', '3×× Redirection'),
(22, '308', '308 Permanent Redirect (RFC 7538)', 'The request and all future requests should be repeated using another URI. 307 and 308 parallel the behaviors of 302 and 301, but  <i>do not allow the HTTP method to change</i>. So, for example, submitting a form to a permanently redirected resource may continue smoothly. <sup id=\"cite_ref-rfc7238_31-0\" class=\"reference\"> <a href=\"#cite_note-rfc7238-31\">[30]</a> </sup>', '3×× Redirection'),
(23, '400', '400 Bad Request', 'The server cannot or will not process the request due to an apparent client error (e.g., malformed request syntax, too large size, invalid request message framing, or deceptive request routing). <sup id=\"cite_ref-rfc7231-400_33-0\" class=\"reference\"> <a href=\"#cite_note-rfc7231-400-33\">[32]</a> </sup>', '4×× Client Error'),
(24, '401', '401 Unauthorized ( RFC 7235)', 'Similar to  <i>403 Forbidden</i>, but specifically for use when authentication is required and has failed or has not yet been provided. The response must include a WWW-Authenticate header field containing a challenge applicable to the requested resource. See  <a href=\"/wiki/Basic_access_authentication\" title=\"Basic access authentication\">Basic access authentication</a> and  <a href=\"/wiki/Digest_access_authentication\" title=\"Digest access authentication\">Digest access authentication</a>. <sup id=\"cite_ref-34\" class=\"reference\"> <a href=\"#cite_note-34\">[33]</a> </sup> 401 semantically means  <a href=\"/wiki/Authentication\" title=\"Authentication\">\"unauthenticated\"</a>, <sup id=\"cite_ref-rfc7235-401_35-0\" class=\"reference\"> <a href=\"#cite_note-rfc7235-401-35\">[34]</a> </sup> i.e. the user does not have the necessary credentials. <br>Note: Some sites issue HTTP 401 when an  <a href=\"/wiki/IP_address\" title=\"IP address\">IP address</a> is banned from the website (usually the website domain) and that specific address is refused permission to access a website.', '4×× Client Error'),
(25, '402', '402 Payment Required', 'Reserved for future use. The original intention was that this code might be used as part of some form of  <a href=\"/wiki/Digital_cash\" class=\"mw-redirect\" title=\"Digital cash\">digital cash</a> or  <a href=\"/wiki/Micropayment\" title=\"Micropayment\">micropayment</a> scheme, but that has not happened, and this code is not usually used.  <a href=\"/wiki/Google_Developers\" title=\"Google Developers\">Google Developers</a> API uses this status if a particular developer has exceeded the daily limit on requests. <sup id=\"cite_ref-GoogleDevelopersErrorCode_36-0\" class=\"reference\"> <a href=\"#cite_note-GoogleDevelopersErrorCode-36\">[35]</a> </sup>', '4×× Client Error'),
(26, '403', '403 Forbidden', 'The request was a valid request, but the server is refusing to respond to it. The user might be logged in but does not have the necessary permissions for the resource.', '4×× Client Error'),
(27, '404', '404 Not Found', 'The requested resource could not be found but may be available in the future. Subsequent requests by the client are permissible. <sup id=\"cite_ref-37\" class=\"reference\"> <a href=\"#cite_note-37\">[36]</a> </sup>', '4×× Client Error'),
(28, '405', '405 Method Not Allowed', 'A request method is not supported for the requested resource; for example, a GET request on a form which requires data to be presented via  <a href=\"/wiki/POST_(HTTP)\" title=\"POST (HTTP)\">POST</a>, or a PUT request on a read-only resource.', '4×× Client Error'),
(29, '406', '406 Not Acceptable', 'The requested resource is capable of generating only content not acceptable according to the Accept headers sent in the request. <sup id=\"cite_ref-38\" class=\"reference\"> <a href=\"#cite_note-38\">[37]</a> </sup> See  <a href=\"/wiki/Content_negotiation\" title=\"Content negotiation\">Content negotiation</a>.', '4×× Client Error'),
(30, '407', '407 Proxy Authentication Required ( RFC 7235)', 'The client must first authenticate itself with the  <a href=\"/wiki/Proxy_server\" title=\"Proxy server\">proxy</a>. <sup id=\"cite_ref-39\" class=\"reference\"> <a href=\"#cite_note-39\">[38]</a> </sup>', '4×× Client Error'),
(31, '408', '408 Request Time-out', 'The server timed out waiting for the request. According to HTTP specifications: \"The client did not produce a request within the time that the server was prepared to wait. The client MAY repeat the request without modifications at any later time.\" <sup id=\"cite_ref-40\" class=\"reference\"> <a href=\"#cite_note-40\">[39]</a> </sup>', '4×× Client Error'),
(32, '409', '409 Conflict', 'Indicates that the request could not be processed because of conflict in the request, such as an  <a href=\"/wiki/Edit_conflict\" title=\"Edit conflict\">edit conflict</a> between multiple simultaneous updates.', '4×× Client Error'),
(33, '410', '410 Gone', 'Indicates that the resource requested is no longer available and will not be available again. This should be used when a resource has been intentionally removed and the resource should be purged. Upon receiving a 410 status code, the client should not request the resource in the future. Clients such as search engines should remove the resource from their indices. <sup id=\"cite_ref-HTTP_410_41-0\" class=\"reference\"> <a href=\"#cite_note-HTTP_410-41\">[40]</a> </sup> Most use cases do not require clients and search engines to purge the resource, and a \"404 Not Found\" may be used instead.', '4×× Client Error'),
(34, '411', '411 Length Required', 'The request did not specify the length of its content, which is required by the requested resource. <sup id=\"cite_ref-42\" class=\"reference\"> <a href=\"#cite_note-42\">[41]</a> </sup>', '4×× Client Error'),
(35, '412', '412 Precondition Failed ( RFC 7232)', 'The server does not meet one of the preconditions that the requester put on the request. <sup id=\"cite_ref-43\" class=\"reference\"> <a href=\"#cite_note-43\">[42]</a> </sup>', '4×× Client Error'),
(36, '413', '413 Payload Too Large ( RFC 7231)', 'The request is larger than the server is willing or able to process. Previously called \"Request Entity Too Large\". <sup id=\"cite_ref-44\" class=\"reference\"> <a href=\"#cite_note-44\">[43]</a> </sup>', '4×× Client Error'),
(37, '414', '414 URI Too Long ( RFC 7231)', 'The  <a href=\"/wiki/URI\" class=\"mw-redirect\" title=\"URI\">URI</a> provided was too long for the server to process. Often the result of too much data being encoded as a query-string of a GET request, in which case it should be converted to a POST request. <sup id=\"cite_ref-45\" class=\"reference\"> <a href=\"#cite_note-45\">[44]</a> </sup> Called \"Request-URI Too Long\" previously. <sup id=\"cite_ref-46\" class=\"reference\"> <a href=\"#cite_note-46\">[45]</a> </sup>', '4×× Client Error'),
(38, '415', '415 Unsupported Media Type', 'The request entity has a  <a href=\"/wiki/Internet_media_type\" class=\"mw-redirect\" title=\"Internet media type\">media type</a> which the server or resource does not support. For example, the client uploads an image as  <a href=\"/wiki/Scalable_Vector_Graphics\" title=\"Scalable Vector Graphics\">image/svg+xml</a>, but the server requires that images use a different format.', '4×× Client Error'),
(39, '416', '416 Range Not Satisfiable ( RFC 7233)', 'The client has asked for a portion of the file ( <a href=\"/wiki/Byte_serving\" title=\"Byte serving\">byte serving</a>), but the server cannot supply that portion. For example, if the client asked for a part of the file that lies beyond the end of the file. <sup id=\"cite_ref-47\" class=\"reference\"> <a href=\"#cite_note-47\">[46]</a> </sup> Called \"Requested Range Not Satisfiable\" previously. <sup id=\"cite_ref-48\" class=\"reference\"> <a href=\"#cite_note-48\">[47]</a> </sup>', '4×× Client Error'),
(40, '417', '417 Expectation Failed', 'The server cannot meet the requirements of the Expect request-header field. <sup id=\"cite_ref-49\" class=\"reference\"> <a href=\"#cite_note-49\">[48]</a> </sup>', '4×× Client Error'),
(41, '418', '418 I\'m a teapot (RFC 2324)', 'This code was defined in 1998 as one of the traditional  <a href=\"/wiki/Internet_Engineering_Task_Force\" title=\"Internet Engineering Task Force\">IETF</a> <a href=\"/wiki/April_Fools%27_Day_RFC\" class=\"mw-redirect\" title=\"April Fools\' Day RFC\">April Fools\' jokes</a>, in  <a class=\"external mw-magiclink-rfc\" rel=\"nofollow\" href=\"//tools.ietf.org/html/rfc2324\">RFC 2324</a>,  <i> <a href=\"/wiki/Hyper_Text_Coffee_Pot_Control_Protocol\" title=\"Hyper Text Coffee Pot Control Protocol\">Hyper Text Coffee Pot Control Protocol</a> </i>, and is not expected to be implemented by actual HTTP servers. The RFC specifies this code should be returned by teapots requested to brew coffee. <sup id=\"cite_ref-50\" class=\"reference\"> <a href=\"#cite_note-50\">[49]</a> </sup> This HTTP status is used as an  <a href=\"/wiki/Easter_egg_(media)\" title=\"Easter egg (media)\">Easter egg</a> in some websites, including  <a href=\"/wiki/Google.com\" class=\"mw-redirect\" title=\"Google.com\">Google.com</a>. <sup id=\"cite_ref-51\" class=\"reference\"> <a href=\"#cite_note-51\">[50]</a> </sup>', '4×× Client Error'),
(42, '421', '421 Misdirected Request ( RFC 7540)', 'The request was directed at a server that is not able to produce a response (for example because a connection reuse). <sup id=\"cite_ref-HTTP2_52-0\" class=\"reference\"> <a href=\"#cite_note-HTTP2-52\">[51]</a> </sup>', '4×× Client Error'),
(43, '422', '422 Unprocessable Entity (WebDAV; RFC 4918)', 'The request was well-formed but was unable to be followed due to semantic errors. <sup id=\"cite_ref-RFC_4918_16-1\" class=\"reference\"> <a href=\"#cite_note-RFC_4918-16\">[15]</a> </sup>', '4×× Client Error'),
(44, '423', '423 Locked (WebDAV; RFC 4918)', 'The resource that is being accessed is locked. <sup id=\"cite_ref-RFC_4918_16-2\" class=\"reference\"> <a href=\"#cite_note-RFC_4918-16\">[15]</a> </sup>', '4×× Client Error'),
(45, '424', '424 Failed Dependency (WebDAV; RFC 4918)', 'The request failed due to failure of a previous request (e.g., a PROPPATCH). <sup id=\"cite_ref-RFC_4918_16-3\" class=\"reference\"> <a href=\"#cite_note-RFC_4918-16\">[15]</a> </sup>', '4×× Client Error'),
(46, '426', '426 Upgrade Required', 'The client should switch to a different protocol such as  <a href=\"/wiki/Transport_Layer_Security\" title=\"Transport Layer Security\">TLS/1.0</a>, given in the  <a href=\"/wiki/Upgrade_header\" class=\"mw-redirect\" title=\"Upgrade header\">Upgrade header</a> field. <sup id=\"cite_ref-53\" class=\"reference\"> <a href=\"#cite_note-53\">[52]</a> </sup>', '4×× Client Error'),
(47, '428', '428 Precondition Required ( RFC 6585)', 'The origin server requires the request to be conditional. Intended to prevent \"the \'lost update\' problem, where a client GETs a resource\'s state, modifies it, and PUTs it back to the server, when meanwhile a third party has modified the state on the server, leading to a conflict.\" <sup id=\"cite_ref-rfc6585_54-0\" class=\"reference\"> <a href=\"#cite_note-rfc6585-54\">[53]</a> </sup>', '4×× Client Error'),
(48, '429', '429 Too Many Requests ( RFC 6585)', 'The user has sent too many requests in a given amount of time. Intended for use with  <a href=\"/wiki/Rate_limiting\" title=\"Rate limiting\">rate-limiting</a> schemes. <sup id=\"cite_ref-rfc6585_54-1\" class=\"reference\"> <a href=\"#cite_note-rfc6585-54\">[53]</a> </sup>', '4×× Client Error'),
(49, '431', '431 Request Header Fields Too Large ( RFC 6585)', 'The server is unwilling to process the request because either an individual header field, or all the header fields collectively, are too large. <sup id=\"cite_ref-rfc6585_54-2\" class=\"reference\"> <a href=\"#cite_note-rfc6585-54\">[53]</a> </sup>', '4×× Client Error'),
(50, '451', '451 Unavailable For Legal Reasons ( RFC 7725)', 'A server operator has received a legal demand to deny access to a resource or to a set of resources that includes the requested resource. <sup id=\"cite_ref-55\" class=\"reference\"> <a href=\"#cite_note-55\">[54]</a> </sup> The code 451 was chosen as a reference to the novel  <a href=\"/wiki/Fahrenheit_451\" title=\"Fahrenheit 451\">Fahrenheit 451</a>.', '4×× Client Error'),
(51, '500', '500 Internal Server Error', 'A generic error message, given when an unexpected condition was encountered and no more specific message is suitable. <sup id=\"cite_ref-58\" class=\"reference\"> <a href=\"#cite_note-58\">[57]</a> </sup>', '5×× Server Error'),
(52, '501', '501 Not Implemented', 'The server either does not recognize the request method, or it lacks the ability to fulfill the request. Usually this implies future availability (e.g., a new feature of a web-service API). <sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">[ <i> <a href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"> <span title=\"This claim needs references to reliable sources. (July 2016)\">citation needed</span> </a> </i>] </sup>', '5×× Server Error'),
(53, '502', '502 Bad Gateway', 'The server was acting as a  <a href=\"/wiki/Gateway_(telecommunications)\" title=\"Gateway (telecommunications)\">gateway</a> or proxy and received an invalid response from the upstream server. <sup id=\"cite_ref-59\" class=\"reference\"> <a href=\"#cite_note-59\">[58]</a> </sup>', '5×× Server Error'),
(54, '503', '503 Service Unavailable', 'The server is currently unavailable (because it is overloaded or down for maintenance). Generally, this is a temporary state. <sup id=\"cite_ref-60\" class=\"reference\"> <a href=\"#cite_note-60\">[59]</a> </sup>', '5×× Server Error'),
(55, '504', '504 Gateway Time-out', 'The server was acting as a gateway or proxy and did not receive a timely response from the upstream server. <sup id=\"cite_ref-61\" class=\"reference\"> <a href=\"#cite_note-61\">[60]</a> </sup>', '5×× Server Error'),
(56, '505', '505 HTTP Version Not Supported', 'The server does not support the HTTP protocol version used in the request. <sup id=\"cite_ref-62\" class=\"reference\"> <a href=\"#cite_note-62\">[61]</a> </sup>', '5×× Server Error'),
(57, '506', '506 Variant Also Negotiates (RFC 2295)', 'Transparent  <a href=\"/wiki/Content_negotiation\" title=\"Content negotiation\">content negotiation</a> for the request results in a  <a href=\"/wiki/Circular_reference\" title=\"Circular reference\">circular reference</a>. <sup id=\"cite_ref-RFC_2295_63-0\" class=\"reference\"> <a href=\"#cite_note-RFC_2295-63\">[62]</a> </sup>', '5×× Server Error'),
(58, '507', '507 Insufficient Storage (WebDAV; RFC 4918)', 'The server is unable to store the representation needed to complete the request. <sup id=\"cite_ref-RFC_4918_16-4\" class=\"reference\"> <a href=\"#cite_note-RFC_4918-16\">[15]</a> </sup>', '5×× Server Error'),
(59, '508', '508 Loop Detected (WebDAV; RFC 5842)', 'The server detected an infinite loop while processing the request (sent in lieu of  <a href=\"#208\">208 Already Reported</a>).', '5×× Server Error'),
(60, '510', '510 Not Extended ( RFC 2774)', 'Further extensions to the request are required for the server to fulfill it. <sup id=\"cite_ref-RFC_2774_64-0\" class=\"reference\"> <a href=\"#cite_note-RFC_2774-64\">[63]</a> </sup>', '5×× Server Error'),
(61, '511', '511 Network Authentication Required ( RFC 6585)', 'The client needs to authenticate to gain network access. Intended for use by intercepting proxies used to control access to the network (e.g., \" <a href=\"/wiki/Captive_portal\" title=\"Captive portal\">captive portals</a>\" used to require agreement to Terms of Service before granting full Internet access via a  <a href=\"/wiki/Hotspot_(Wi-Fi)\" title=\"Hotspot (Wi-Fi)\">Wi-Fi hotspot</a>). <sup id=\"cite_ref-rfc6585_54-3\" class=\"reference\"> <a href=\"#cite_note-rfc6585-54\">[53]</a> </sup>', '5×× Server Error'),
(62, '103', '103 Checkpoint', 'Used in the resumable requests proposal to resume aborted PUT or POST requests. <sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">[ <i> <a href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"> <span title=\"This claim needs references to reliable sources. (November 2016)\">citation needed</span> </a> </i>] </sup>', '1×× Informational'),
(63, '103', '103 Early Hints', 'Used to return some response headers before entire HTTP response.  <sup id=\"cite_ref-65\" class=\"reference\"> <a href=\"#cite_note-65\">[64]</a> </sup> <sup id=\"cite_ref-66\" class=\"reference\"> <a href=\"#cite_note-66\">[65]</a> </sup>', '1×× Informational'),
(64, '419', '419 I\'m a fox (Smoothwall/Foxwall)', 'Returned by some versions of Smoothwall and Foxwall firewall systems when a config test is returned. <sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">[ <i> <a href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"> <span title=\"This claim needs references to reliable sources. (November 2016)\">citation needed</span> </a> </i>] </sup>', '4×× Client Error'),
(65, '420', '420 Method Failure ( Spring Framework)', 'A deprecated response used by the Spring Framework when a method has failed. <sup id=\"cite_ref-67\" class=\"reference\"> <a href=\"#cite_note-67\">[66]</a> </sup>', '4×× Client Error'),
(66, '420', '420 Enhance Your Calm ( Twitter)', 'Returned by version 1 of the Twitter Search and Trends API when the client is being rate limited; versions 1.1 and later use the  <a href=\"#429\">429 Too Many Requests</a> response code instead. <sup id=\"cite_ref-TwitterErrorCodes_68-0\" class=\"reference\"> <a href=\"#cite_note-TwitterErrorCodes-68\">[67]</a> </sup>', '4×× Client Error'),
(67, '450', '450 Blocked by Windows Parental Controls (Microsoft)', 'A Microsoft extension. This error is given when Windows Parental Controls are turned on and are blocking access to the given webpage. <sup id=\"cite_ref-69\" class=\"reference\"> <a href=\"#cite_note-69\">[68]</a> </sup>', '4×× Client Error'),
(68, '498', '498 Invalid Token (Esri)', 'Returned by  <a href=\"/wiki/ArcGIS_Server\" title=\"ArcGIS Server\">ArcGIS for Server</a>. A code of 498 indicates an expired or otherwise invalid token. <sup id=\"cite_ref-arcgis_70-0\" class=\"reference\"> <a href=\"#cite_note-arcgis-70\">[69]</a> </sup>', '4×× Client Error'),
(69, '499', '499 Token Required (Esri)', 'Returned by  ArcGIS for Server. A code of 499 indicates that a token is required but was not submitted.', '4×× Client Error'),
(70, '499', '499 Request has been forbidden by antivirus', 'Produced by some programs such as  <a href=\"/wiki/Wget\" title=\"Wget\">Wget</a> when a malicious site is intercepted. <sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">[ <i> <a href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"> <span title=\"This claim needs references to reliable sources. (August 2016)\">citation needed</span> </a> </i>] </sup>', '4×× Client Error'),
(71, '509', '509 Bandwidth Limit Exceeded ( Apache Web Server/ cPanel)', 'The server has exceeded the bandwidth specified by the server administrator; this is often used by shared hosting providers to limit the bandwidth of customers. <sup id=\"cite_ref-71\" class=\"reference\"> <a href=\"#cite_note-71\">[70]</a> </sup>', '5×× Server Error'),
(72, '530', '530 Site is frozen', 'Used by the  <a href=\"/wiki/Pantheon_(software)\" title=\"Pantheon (software)\">Pantheon</a> web platform to indicate a site that has been frozen due to inactivity. <sup id=\"cite_ref-72\" class=\"reference\"> <a href=\"#cite_note-72\">[71]</a> </sup>', '5×× Server Error'),
(73, '598', '598 (Informal convention) Network read timeout error', 'Used by some HTTP proxies to signal a network read timeout behind the proxy to a client in front of the proxy. <sup id=\"cite_ref-73\" class=\"reference\"> <a href=\"#cite_note-73\">[72]</a> </sup> <sup id=\"cite_ref-74\" class=\"reference\"> <a href=\"#cite_note-74\">[73]</a> </sup>', '5×× Server Error'),
(74, '599', '599 (Informal convention) Network connect timeout error', 'Used to indicate when the connection to the network times out. <sup id=\"cite_ref-75\" class=\"reference\"> <a href=\"#cite_note-75\">[74]</a> </sup> <sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">[ <i> <a href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"> <span title=\"This claim needs references to reliable sources. (November 2016)\">citation needed</span> </a> </i>] </sup>', '5×× Server Error'),
(75, '440', '440 Login Time-out', 'The client\'s session has expired and must log in again. <sup id=\"cite_ref-MS_KB941201_76-0\" class=\"reference\"> <a href=\"#cite_note-MS_KB941201-76\">[75]</a> </sup>', '4×× Client Error'),
(76, '449', '449 Retry With', 'The server cannot honour the request because the user has not provided the required information. <sup id=\"cite_ref-MS_DD891478_77-0\" class=\"reference\"> <a href=\"#cite_note-MS_DD891478-77\">[76]</a> </sup>', '4×× Client Error'),
(77, '451', '451 Redirect', 'Used in  <a href=\"/wiki/Exchange_ActiveSync\" title=\"Exchange ActiveSync\">Exchange ActiveSync</a> when either a more efficient server is available or the server cannot access the users\' mailbox. <sup id=\"cite_ref-78\" class=\"reference\"> <a href=\"#cite_note-78\">[77]</a> </sup> The client is expected to re-run the HTTP AutoDiscover operation to find a more appropriate server. <sup id=\"cite_ref-79\" class=\"reference\"> <a href=\"#cite_note-79\">[78]</a> </sup>', '4×× Client Error'),
(78, '444', '444 No Response', 'Used to indicate that the server has returned no information to the client and closed the connection.', '4×× Client Error'),
(79, '495', '495 SSL Certificate Error', 'An expansion of the  <a href=\"#400\">400 Bad Request</a> response code, used when the client has provided an invalid  <a href=\"/wiki/Client_certificate\" title=\"Client certificate\">client certificate</a>.', '4×× Client Error'),
(80, '496', '496 SSL Certificate Required', 'An expansion of the  <a href=\"#400\">400 Bad Request</a> response code, used when a client certificate is required but not provided.', '4×× Client Error'),
(81, '497', '497 HTTP Request Sent to HTTPS Port', 'An expansion of the  <a href=\"#400\">400 Bad Request</a> response code, used when the client has made a HTTP request to a port listening for HTTPS requests.', '4×× Client Error'),
(82, '499', '499 Client Closed Request', 'Used when the client has closed the request before the server could send a response.', '4×× Client Error'),
(83, '520', '520 Unknown Error', 'The 520 error is used as a \"catch-all response for when the origin server returns something unexpected\", listing connection resets, large headers, and empty or invalid responses as common triggers.', '5×× Server Error');
INSERT INTO `api_http_resonse` (`id`, `code`, `title`, `description`, `type`) VALUES
(84, '521', '521 Web Server Is Down', 'The origin server has refused the connection from Cloudflare.', '5×× Server Error'),
(85, '522', '522 Connection Timed Out', 'Cloudflare could not negotiate a  <a href=\"/wiki/TCP_handshake\" class=\"mw-redirect\" title=\"TCP handshake\">TCP handshake</a> with the origin server.', '5×× Server Error'),
(86, '523', '523 Origin Is Unreachable', 'Cloudflare could not reach the origin server; for example, if the  <a href=\"/wiki/DNS_record\" class=\"mw-redirect\" title=\"DNS record\">DNS records</a> for the origin server are incorrect.', '5×× Server Error'),
(87, '524', '524 A Timeout Occurred', 'Cloudflare was able to complete a TCP connection to the origin server, but did not receive a timely HTTP response.', '5×× Server Error'),
(88, '525', '525 SSL Handshake Failed', 'Cloudflare could not negotiate a  <a href=\"/wiki/Transport_Layer_Security#TLS_handshake\" title=\"Transport Layer Security\">SSL/TLS handshake</a> with the origin server.', '5×× Server Error'),
(89, '526', '526 Invalid SSL Certificate', 'Cloudflare could not validate the SSL/TLS certificate that the origin server presented.', '5×× Server Error'),
(90, '527', '527 Railgun Error', 'A 527 error indicates that the requests timeout or failed after the WAN connection has been established. <sup id=\"cite_ref-83\" class=\"reference\"> <a href=\"#cite_note-83\">[82]</a> </sup>', '5×× Server Error');
